import React, { useState, useEffect } from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Paper from "@mui/material/Paper";
import Typography from "@mui/material/Typography";
import { createTheme, ThemeProvider } from "@mui/material/styles";

const theme = createTheme({
  palette: {
    white: {
      main: "#ffffff",
      contrastText: "#ffffff",
    },
  },
});
const SearchBar = () => {
  return (
    <>
      <Paper
        sx={{
          backgroundColor: "#010101",
          //width: "30ch",
          width: "90%",
          maxWidth: "30rem",
          margin: "auto",
          paddingBottom: "20px",
          paddingTop: "20px",
        }}
      >
        <Box
          component="form"
          sx={{
            "& .MuiTextField-root": { m: 1, width: "25ch" },
            margin: "auto",
            textAlign: "center",
          }}
          noValidate
          autoComplete="off"
        >
          <Typography
            variant="subtitle2"
            sx={{
              color: "#ffffff",
              fontFamily: "Happiness-Sans-Title",
              fontSize: "18px",
              marginBottom: "8px",
            }}
          >
            검색
          </Typography>
          <ThemeProvider theme={theme}>
            <TextField
              id="standard-search"
              type="search"
              variant="standard"
              color="white"
              value="검색"
              inputProps={{
                style: {
                  color: "#fafafa",
                  fontFamily: "Happiness-Sans-Title",
                  fontSize: "16px",
                },
              }}
              focused
            />
          </ThemeProvider>
        </Box>
      </Paper>
    </>
  );
};

export default SearchBar;
